Kua whiwhihia e ta maatau kamupene 16 nga patene tenenga o te ao, 30 nga paanui a-motu me te neke atu i te 50 nga tauira whaipainga:
● I te tau 1998, i whakanuia hei hua hou matua mo te motu;
● I te tau 1998, i whakawhiwhia te mira poupou ki te Tohu Tuatahi o Changsha Scientific and Technological Progress;
● I te tau 1999 me te 2010, i whakawhiwhia ki a ia te kaupapa o te Putea Whakahoutanga o te Putaiao me te Hangarau e te Manatu Putaiao me te Hangarau o te Repupirita Tangata o Haina;
● I te ta
