;
● Mai i te 2013 ki te 2016, i whakanuia te kamupene ko Changsha Intellectual Property Demonstration Enterprise;
● I whakahaeretia te Kaupapa Mahere Putaiao me te Hangarau o Changsha City 2014 i te tau 2014-2016 ka tutuki pai te whakaaetanga;
● Ko te kamupene kua mohiotia tonu hei hinonga hangarau teitei mai i te 1994 ki tenei wa;
● I te 2015, ko te tohu a te kamupene "Pillar Mill" i mohiotia ko Hunan Famous Trademark;
● Tohu Tuatahi o Haina Hiko Hiko Science and Technology Progress Award i 201
... (968 chars skipped) ...
tauira kareti i Hunan Xiangjiang New District i te tau 2023.
● I paahitia te tiwhikete punaha whakahaere taiao i te tau 2023
● I paahitia te Tiwhikete Whakahaere Hauora me te Haumaru Mahi i te tau 2023
Mo nga tau kotahi tekau, kua whakawhiwhia te kamupene ki te taitara "Te Whakahonore i nga kirimana me te pupuri i nga kupu whakaari" na te whakahaere a Hunan mo te Ahumahi me te Tauhokohoko me te Kawanatanga o Hunan, a kua whakawhiwhia ki te taitara "Tekau o nga umanga motuhake i te rohe o Hunan".
